CREATE TABLE `Connections` (
  `idConnection` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `travelTime` int(10) unsigned DEFAULT NULL,
  `line` int(10) unsigned NOT NULL,
  `origStop` int(10) unsigned NOT NULL,
  `destStop` int(10) unsigned NOT NULL,
  PRIMARY KEY (`idConnection`),
  UNIQUE KEY `SECONDARY` (`line`,`origStop`,`destStop`),
  KEY `fk_Connections_Lines` (`line`),
  KEY `fk_Connections_Stops1` (`origStop`),
  KEY `fk_Connections_Stops2` (`destStop`),
  CONSTRAINT `fk_Connections_Lines` FOREIGN KEY (`line`) REFERENCES `Transports` (`idTransport`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Connections_Stops1` FOREIGN KEY (`origStop`) REFERENCES `Stops` (`idstop`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_Connections_Stops2` FOREIGN KEY (`destStop`) REFERENCES `Stops` (`idstop`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=152746 DEFAULT CHARSET=utf8;



